import React, { useState } from 'react'
import './App.css'

export default function CardDisplay() {

    const [count, setCount] = useState(10);
    const [count2, setCount2] = useState(20);

    return (
        <div>
            <h3>Card Result Page</h3>
            <button onClick={() => {
                setCount(c => (c = c + 1))
                setCount2(c => c +1)
            }}>
                Increase Count
            </button>
            <div>Count 1: {count}</div>
            <div>Count 2: {count2}</div>
        </div>
    )
}
